function configChart(data) {
  //   console.log(_apiItem);
  const testData = data
    .filter((item, idx) => {
      if (idx % 5 === 0) {
        return item.positive;
      }
    })
    .map(filt => {
      return filt.positive;
    });

  //   passData.map(filt => {
  //     return filt._apiItem;
  //   });
  return testData;
}

export { configChart };
